import React from 'react';
import './Home.css';
import cafeImage from '../assets/cafe.jpeg';
import coffeeImage from '../assets/cafe.jpeg';
import bakeryImage from '../assets/cafe.jpeg'; // Adjust the path based on your structure

const Home = () => {
  return (
    <div id="home" className="home">
      {/* Image Section */}
      <div className="home-image-container">
        <img src={cafeImage} alt="Food Hall Cafe" className="home-image" />
        <img src={coffeeImage} alt="coffee" className="home-image" />
        <img src={bakeryImage} alt="coffee" className="home-image" />

        <img src="path/to/image3.jpg" alt="Cozy Seating Area" />
        <img src="path/to/image4.jpg" alt="Outdoor View" />
      </div>

      {/* Content Section */}
      <div className="home-content">
        <h1>Welcome to Food Hall Cafe</h1>
        <p>Experience the perfect blend of comfort, taste, and ambiance. Join us for an unforgettable coffee experience!</p>
      </div>
    </div>
  );
};

export default Home;
